import React, { useContext, useState } from 'react'
import { DataContext } from '../Context/DataContext';

function TestInfo() {

  const  {record, setRecord} = useContext(DataContext);

      // Test variables ...
const [test_number, setTest_number] = useState("");
const [name, setName] = useState("");
const [pass_mark, setPass_mark] = useState("");
const [description, setDescription] = useState("");
const [instructions, setInstructions] = useState("");
const [start, setStart] = useState("");
const [duration, setDuration] = useState("");
const [timed, setTimed] = useState(false)
const [created, setCreated] = useState(new Date().toISOString());
const [questions, setQuestions] = useState([])
const [loading, setLoading] = useState(false);


const date = new Date().toISOString().substring(0, 10);
const [msg, setMsg] = useState('');

//handle submit functions
function handleSubmit(e){
    e.preventDefault();


    const data = {
        test_number, 
        name, 
        pass_mark, 
        description, 
        instructions, 
        start,
        duration, 
        timed,
        questions
      };

     console.log(data); 
     setLoading(true);
     const json = JSON.stringify(data);



     const headers = {
      'Content-Type': 'application/json'
    }

    {/*
    axios.post('https://enigmatic-cove-89902.herokuapp.com/api/v1/test', json, {
        headers: headers
      })
      .then((response) => {
        setLoading(false);
        setMsg('New Record Added Successfully');
        console.log(response);
      })
      .catch((error) => {
        console.log(error.message);
        setLoading(false)
        setMsg(error.message);
      }) 

  */}



     setTest_number("");
      setDescription(""); 
      setName(""); 
      setPass_mark("");
      setStart("");
      setDuration(""); 
      setInstructions("");
      setTimed("");

  }



  return(
     <div>

     <div className='head_schedule'>
             <h4>Schedule Exam  </h4>
              <h5>Created:  

             <em> {date} </em>

             </h5>
     </div>

   <div className='schedule_form'>

       <form onSubmit={handleSubmit}>

         <p>
           <label>
             Test Number: <br /><input 
                 type='text' 
                 name='test_number' 
                 onChange={(e) => {setTest_number(e.target.value)} }
                 value={test_number}
                 />          
           </label>
         </p>
         <p>
         <label>
         Test Name: <br /><input 
               type='text' 
               name='name' 
               onChange={(e) => {setName(e.target.value)} }
               value={name}
               />
         </label>
         </p>
         <p>
         <label>Pass Mark: <br /><input 
               type='number' 
               name='pass_mark' 
               onChange={(e) => {setPass_mark(e.target.value)}}
               value={pass_mark}
               /> </label>
         </p>      

           <p><label>Description: <br /><textarea 
               name='describtion' 
               onChange={(e) => {setDescription(e.target.value)} }
               value={description}
               />
               </label>
           </p>

           <p><label>Instruction: <br />
           <textarea 
               name='instruction' 
               onChange={(e) => {setInstructions(e.target.value)} }
               value={instructions}
           />
           </label>
           </p>

           <p>
           <label>
               Start: <br /><input 
                   type='datetime-local' 
                   name='start'  
                   onChange={(e)=>{setStart(e.target.value)}}  
                   value={start}
                 />
           </label> 
           </p>

           <p><label>Dur in sec: <br /><input 
               type="number" 
               name='dur' 
               step='1' 
               min="02:00:00" 
               max="20:00:00" 
               onChange={(e)=>{setDuration(e.target.value)}}  
               value={duration}
               />
           </label>
           </p>
           <p>
             <label>Timed: <input 
             type='checkbox' 
             name='timed' 
             checked={timed}
             onChange={(e)=> {setTimed(!timed) }} />
             </label>
           </p>  

           <button>Submit</button>

       </form>
   </div>
     </div>
     ); 

}

export default TestInfo
